import React from "react";
import picture1 from './picture1.jpg';
import picture2 from './picture2.jpg';
import { Buffer } from 'buffer';

const axios = require("axios");
const qs = require("qs");
const getToken = async (
  clientId = 'f25a526cf53d42c7b794db522c42ab98',
  clientSecret = 'c02064daeda847dc99b9ebd7024e8f5d'
) => {
  const headers = {
    headers: {
      Accept: "application/json",
      "Content-Type": "application/x-www-form-urlencoded",
    },
    auth: {
      username: clientId,
      password: clientSecret,
    },
  };
  const data = {
    grant_type: "client_credentials",
  };
  try {
    const response = await axios.post(
      "https://accounts.spotify.com/api/token",
      qs.stringify(data),
      headers
    );
  return response.data.access_token;
  } catch (err) {
    console.log(err);
  }
};


class MainComponent extends React.Component {

    render() {
        return (
        <div>
            <h1>Guessing Game</h1>
            <h2>Based On Spotify's Information Which Album, Track, or Artist is more popular?</h2>
            <img style={{"width" : "20rem"}} src={picture1} alt="logo" />
            <img style={{"width" : "20rem"}}src={picture2} alt="logo" />
        </div>
        )}
}

export default MainComponent
